import React from 'react';
import ReactDOM from 'react-dom';
import { RouterProvider, createBrowserRouter } from 'react-router-dom';

import Registration from './Registration';

const router = createBrowserRouter([
  {
    path: '/',
    element: <Registration></Registration>,
  },
  {
    path:'/login'
  }
]);

const root = document.getElementById('root'); // Correct the placement of this line
const app = (
  <React.StrictMode>
    <RouterProvider router={router}>{/* Add your components here */}</RouterProvider>
  </React.StrictMode>
);

ReactDOM.render(app, root); // Correct the usage of ReactDOM.render
